#include<stdio.h>
#include<string.h>
char findTheDifference(char* s, char* t) 
{
    int lens=0,lent=0;   
    int i=0;
	int shu1[26]={0};
	char ans=0;
	lens=strlen(s);
    lent=strlen(t);
	for(i=0;i<lens;i++)
	{
		shu1[s[i]-'a']++;
	}
	for(i=0;i<lent;i++)
	{
		shu1[t[i]-'a']--;
		if(shu1[t[i]-'a']<0)
		{
			ans=t[i];
			break;
		}
	}
	return ans;
}
int main()
{
	char *str1="";
	char *str2="";
	printf("%c",findTheDifference(str1,str2));
}